import { makeStyles } from '@material-ui/core/styles';


export default makeStyles(() => ({
    paper: {
        margin: "10px",
        background: '#0021A5',
        color: 'blue'
    },
    grid: {
        margin: '10px',
        padding: '10px',
    },
    textfield: {
        color: 'white',
        background: 'white',
        label: 'white',
    },
    icons: {
        color: 'white',
    },
    buttons: {
        background: '#FA4616',
        margin: '10px',
    },
}));
